import React, { Component } from 'react';
class Incomplete extends Component {
    state = {}
    render() {

        return (
            <>
                {
                    this.props.arr.map((data, i) =>{ 
                    if(data.status=="Incomplete")
                    return ''
                    return <li> <input index={i} type="checkbox" name="incompleted" onClick={this.props.actioner} unchecked /><label>{data}</label><input type="text" id="name" className="name" value={data} /><button className="edit" index={i} name="incompleted" onClick={()=>this.props.editClick}>Edit</button><button onClick={this.props.delete} index={i} name="incompleted" className="delete">Delete</button> </li>})
                }
            </>
        );
    }
}

export default Incomplete;
